import React, { useState } from 'react'
import { useHistory } from 'react-router-dom'
const initialState = {
   
    "name": " ",
    "email": "",
    "password": ""
}

const NewUser = () => {

    const [userDetails, setuserDetails] = useState({ name: " ", email: "", password: "" })
    let history = useHistory();
  
    const onChange = (e) => {
        setuserDetails({ ...userDetails, [e.target.name]: e.target.value })
    }

    const handleSubmit = async (e) => {

        e.preventDefault();
        JSON.stringify({name:userDetails.name, email: userDetails.email, password: userDetails.password })

        }

    return (
        <div>
            <form>
                <div class="mt-3 text-center">
                    <h3>Create a new account</h3>
                </div>
                <div class="mb-3">
                    <label for="name" class="form-label">Full Name</label>
                    <input type="text" class="form-control" id="email" value={userDetails.name} onChange={onChange} aria-describedby="emailHelp" />
                </div>
                <div class="mb-3">
                    <label for="email" class="form-label">Email address</label>
                    <input type="email" class="form-control" id="email" value={userDetails.email} onChange={onChange} aria-describedby="emailHelp" />
                    <div id="emailHelp" class="form-text">We'll never share your email with anyone else.</div>
                </div>
                <div class="mb-3">
                    <label for="password" class="form-label" value={password} onChange={onChange}>Password</label>
                    <input type="password" class="form-control" id="password" />
                </div>

                <button type="submit" class="btn btn-primary">Submit</button>
            </form>
        </div>
    )
}

export default NewUser
